package algorithm.leetcode.medium;

import org.junit.jupiter.api.Test;

import static algorithm.leetcode.medium.IsSubsequence.isSubSequence;
import static algorithm.leetcode.medium.IsSubsequence.isSubSequence2;
import static org.junit.jupiter.api.Assertions.*;

class IsSubsequenceTest {


    @Test
    public void testNormalCase() {
        String t = "ahbgdc";
        String s1 = "abc";
        String s2 = "axc";
        assertTrue(isSubSequence(s1, t));
        assertFalse(isSubSequence(s2, t));
    }

    @Test
    public void testErrorCase() {
        String t = "";
//        String t = "yyyyylyyyyyyy";
        String s = "leeeeetcode";
        assertFalse(isSubSequence2(s, t));
//        assertTrue(!isSubSequence(s, t));
    }

    @Test
    public void testLoopMethod() {
        String t = "ahbgdc";
        String s1 = "abc";
        String s2 = "axc";
        assertTrue(isSubSequence2(s1, t));
        assertFalse(isSubSequence2(s2, t));
    }

    @Test
    public void testEmpty() {
        assertTrue(isSubSequence2("", ""));
    }


}